// Bootstrap CSS
import "bootstrap/dist/css/bootstrap.min.css";

function Programs() {
    return(
        <div style={{minHeight:"550px", width:"70%", marginLeft:"15%", display:"flex"}}>
            <div class="card mb-3" style={{width:"27rem"}}>
                <div class="card-body">
                    <h5 class="card-title text-center">Men's Shelter</h5>
                    <p>Open for rebooking at 3:00 PM. </p>
                    <p>Open for new bookings at 7:00 PM</p>
                    <p>Note: If you have not rebooked by 7:00 PM, you could be at risk of losing your spot.</p>
                    <p>123 Rideau Street, Ottawa, ON</p>
                    <p>(123) 456-7890</p>
                    <p>No</p>
                </div>
            </div>
        </div>
    );
}

export default Programs;
